import React from 'react'
import Part from './Part'
const Content = ({ parts }) => {
  return (
    <div>
      {parts.map(part =>
      <div key= {part.id}>
      <Part part={part}/>
      </div>
      )}      
    </div>
  )
}
/* 
<div>
      {courses.map(course =>
      <div key ={course.id}>
        {course.name}
      </div>
      )}
*/
export default Content
